            </div>
            
            

           
          
           <LogoutTwoTone/>
           

            
        </div>
        {/* </OutsideClickHandler> */}

        <div className='menu-icon' onClick={()=>setMenuOpened((prev)=>!prev) }>
          <BiMenuAltRight size={30}/>

        </div>
    </div>
</section>
  )
}

